An Erotic Experience With A Healthy Dose Of Fun!

When his ex-wife leaves for an extended business trip, a community college P.E. teaches hires a cute neighbor girl to be a full-time baby sitter. The perky young woman agrees, but only if he can help her get on the college's tennis team, and soon the one-on-one coaching turns into a fiery love feast as the two discover their penchant for the erotic arts. Starring the sensational Jessa Rhodes, with Dana DeArmond, Erik Everhard, Steven St. Croix, Tyler Nixon and Gigi Loren!


